import React from 'react';
import './Modal.css';


const modal = () => {
    
    return (
       <div className='showModal'>
           <h3>Are You 21 or Older?</h3>
           <button className='yes'>YES</button>
           <button className='no' onClick={this.clickHandler}>NO</button>
       </div>  
    )
};

export default modal;
